    public static bool IsAGolfingItem(Item item)
    {
      if (ProjectileID.Sets.IsAGolfBall[item.shoot])
        return true;
      int type = item.type;
      switch (type)
      {
        case 4039:
        case 4092:
        case 4093:
        case 4094:
        case 4095:
          return true;
        default:
          if ((uint) (type - 4587) > 11U)
            return false;
          goto case 4039;
      }
    }

