              obj.active = false;
            }
            if (Main.netMode != 0 && this.playerIndexTheItemIsReservedFor == Main.myPlayer)
            {
              NetMessage.SendData(21, -1, -1, (NetworkText) null, myItemIndex, 0.0f, 0.0f, 0.0f, 0, 0, 0);
              NetMessage.SendData(21, -1, -1, (NetworkText) null, number, 0.0f, 0.0f, 0.0f, 0, 0, 0);
            }
          }
        }
      }
